import styled from 'styled-components'
import group from './Group.png';




class Home extends Component {
  render(){
  return (


   <div>
     <br/>

      <img className ="group" src={group} alt ="kimberly"/>
      <h2>Hello my name is Kimberly, nice to meet you :)</h2>






    </div>
  );
  }
}

export default Home;
